// SPDX-License-Identifier: MIT

pragma solidity ^0.8.15;



 contract Receiver {


    
    struct ReceiverDetails {
        uint totalFunds;
        uint amount;
        uint money;

    }


    ReceiverDetails rd ;


    function withdrawMoney(uint _money) public returns(uint){
       
        rd.totalFunds = rd.totalFunds - _money;
        rd.money = _money;
        return rd.money;

    }


    function deposit(uint _amount) internal {

        rd.amount = _amount;
        rd.totalFunds = rd.totalFunds  + rd.amount;

    }

    function getBalance() public view returns(uint){

        return rd.totalFunds;
    }

}

